import React from 'react';

function Footer() {
  return (
    <div className="footer">
      <p className="wedDate">Please join us for our wedding celebration,
        August 4th 2022</p>
      <p className="photocredit">Photo Credit: Brittany Fleming -
        Facebook: @bflemingphoto
        Instagram: @bflemingphotography</p>
    </div>
  )
}

export default Footer;
